msSystem.Web/Self/FileUpload/2017/06/14/033477bd-f1da-4a63-86b7-1c38e89e002d.pdf\" style=\"padding: 0px; margin: 0px 0px 0px 20px; color: rgb(0, 0, 0); border: none; text-decoration-line: none; line-height: 40px; font-size: 15px;\">上海城市业余联赛工作手册</a></p></li></ul><p><br/></p>','','',NULL,NULL,'',NULL,'1','1','2018-03-09 11:26:26','1','2018-03-09 11:26:26',NULL,'0',0,0,NULL,NULL),('1520216213051','2','关于北京炼津仁和文化发展中心等三家公司冒用2017年城市业余联赛名称和标识的声明','','',NULL,'','通知公告','近期，上海城市业余联赛办公室接到相关举报， 5月28日，由北京炼津仁和文化发展中心、上海静逸文化发展有限公司、上海羿莘文化发展有限公司三家公司在上海江湾体育场举办的&ldquo;第七回（2017）年CKOU剑道上海段位审查会暨2017年（第四回）华东区CKOU道场战&rdquo;赛事活动，冒用了&ldquo;2017年上海城市业余联赛&rdquo;名称和标识。现经多方核实，情况属实。','\0',27,'<p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">    近期，上海城市业余联赛办公室接到相关举报， 5月28日，由北京炼津仁和文化发展中心、上海静逸文化发展有限公司、上海羿莘文化发展有限公司三家公司在上海江湾体育场举办的“第七回（2017）年CKOU剑道上海段位审查会暨2017年（第四回）华东区CKOU道场战”赛事活动，冒用了“2017年上海城市业余联赛”名称和标识。现经多方核实，情况属实。上海城市业余联赛办公室特此作如下声明：</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">　　一、上海城市业余联赛办公室从未授权北京炼津仁和文化发展中心、上海静逸文化发展有限公司、上海羿莘文化发展有限公司三家公司举办2017年上海城市业余联赛任何赛事活动。“第七回（2017）年CKOU剑道上海段位审查会暨2017年（第四回）华东区CKOU道场战”赛事活动与“2017年上海城市业余联赛”无任何关联。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">　　二、北京炼津仁和文化发展中心、上海静逸文化发展有限公司、上海羿莘文化发展有限公司三家公司的上述行为，严重损害了上海城市业余联赛的形象和利益，侵害了市民正当健身权益。三家公司私自使用“上海城市业余联赛”名称和标识，侵犯了上海城市业余联赛办公室、上海市体育局和上海市体育总会的正当权益。上海城市业余联赛办公室将对侵害“上海城市业余联赛”名誉的违法行为保留法律追究责任的权利。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">　　三、上海城市业余联赛办公室将在上海城市业余联赛官网定期发布赛事安排，同时提醒广大市民提高警惕，避免参与未经授权的相关赛事。如有发现冒用或违规使用上海城市业余联赛的行为，欢迎广大市民及时向上海城市业余联赛办公室举报。举报电话：63278928。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">　　特此声明。</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\"> </p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\"> </p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255); text-align: right;\">上海城市业余联赛办公室</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255); text-align: right;\">2017年6月16日</p><p><br/></p>','','通知,公告',NULL,NULL,'',NULL,'1','1','2018-03-05 10:16:53','1','2018-03-09 11:13:40',NULL,'0',0,0,NULL,NULL),('1520216213052','2','关于北京炼津仁和文化发展中心等三家公司冒用2017年城市业余联赛名称和标识的声明','','',NULL,'','通知公告','近期，上海城市业余联赛办公室接到相关举报， 5月28日，由北京炼津仁和文化发展中心、上海静逸文化发展有限公司、上海羿莘文化发展有限公司三家公司在上海江湾体育场举办的&ldquo;第七回（2017）年CKOU剑道上海段位审查会暨2017年（第四回）华东区CKOU道场战&rdquo;赛事活动，冒用了&ldquo;2017年上海城市业余联赛&rdquo;名称和标识。现经多方核实，情况属实。','\0',10,'<p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">    近期，上海城市业余联赛办公室接到相关举报， 5月28日，由北京炼津仁和文化发展中心、上海静逸文化发展有限公司、上海羿莘文化发展有限公司三家公司在上海江湾体育场举办的“第七回（2017）年CKOU剑道上海段位审查会暨2017年（第四回）华东区CKOU道场战”赛事活动，冒用了“2017年上海城市业余联赛”名称和标识。现经多方核实，情况属实。上海城市业余联赛办公室特此作如下声明：</p><p style=\"padding: 0px; margin-top: 0px; margin-bottom: 0px; border: none; font-family: 微软雅黑; font-size: 13.6px; white-space: normal; background-color: rgb(255, 255, 255);\">　　一、上海城市业余联赛办公室从未授权北京炼津仁和文化发展中心、上海静