/*Table structure for table `cms_article_img` */

DROP TABLE IF EXISTS `cms_article_img`;

CREATE TABLE `cms_article_img` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `pic` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT 'PIC',
  `remarks` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `article_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '文章ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='文章图片集';

