/*Table structure for table `cms_log` */

DROP TABLE IF EXISTS `cms_log`;

CREATE TABLE `cms_log` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `article_id` varchar(64) DEFAULT NULL COMMENT '文章ID',
  `title` varchar(255) DEFAULT '' COMMENT '日志标题',
  `user_id` varchar(64) DEFAULT NULL COMMENT '用户ID',
  `user_name` varchar(64) DEFAULT NULL COMMENT '用户姓名',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `remote_addr` varchar(255) DEFAULT NULL COMMENT '操作IP地址',
  `type` varchar(5) DEFAULT NULL COMMENT '操作方式',
  PRIMARY KEY (`id`),
  KEY `sys_log_create_by` (`user_name`) USING BTREE,
  KEY `sys_log_create_date` (`create_date`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='日志表';

