/*Table structure for table `cultural_couplets` */

DROP TABLE IF EXISTS `cultural_couplets`;

CREATE TABLE `cultural_couplets` (
  `id` varchar(64) NOT NULL DEFAULT '' COMMENT '主键',
  `name` varchar(255) DEFAULT NULL COMMENT '标题',
  `picture` varchar(255) DEFAULT NULL COMMENT '图片',
  `details` longblob COMMENT '详情',
  `size_id` varchar(64) DEFAULT NULL COMMENT '尺寸',
  `frame_id` varchar(64) DEFAULT NULL COMMENT '楹联框',
  `craft_id` varchar(64) DEFAULT NULL COMMENT '制作工艺',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` varchar(64) DEFAULT NULL COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  `lexicon_id` varchar(64) DEFAULT NULL COMMENT '词库',
  `recommend` varchar(64) DEFAULT NULL COMMENT '推荐到首页',
  `price` double DEFAULT NULL COMMENT '定价',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='成品楹联';

