/*Table structure for table `cultural_decoration` */

DROP TABLE IF EXISTS `cultural_decoration`;

CREATE TABLE `cultural_decoration` (
  `id` varchar(64) NOT NULL DEFAULT '' COMMENT '主键',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `details` longblob COMMENT '详情',
  `picture` varchar(255) DEFAULT NULL COMMENT '图片',
  `price` double DEFAULT NULL COMMENT '价格',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` varchar(64) DEFAULT NULL COMMENT '逻辑删除标记（0：显示；1：隐藏）',
  `intro` varchar(180) DEFAULT NULL COMMENT '简介',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='装饰品';

