/*Table structure for table `wx_account` */

DROP TABLE IF EXISTS `wx_account`;

CREATE TABLE `wx_account` (
  `id` varchar(64) NOT NULL,
  `name` varchar(100) DEFAULT NULL COMMENT '公众号名称',
  `account` varchar(100) NOT NULL COMMENT '公众号账号',
  `appid` varchar(100) DEFAULT NULL COMMENT 'appid',
  `appsecret` varchar(100) DEFAULT NULL COMMENT 'appsecret',
  `url` varchar(255) NOT NULL COMMENT '验证时用的url',
  `token` varchar(255) NOT NULL COMMENT 'token',
  `msg_count` int(11) DEFAULT '1' COMMENT '自动回复消息条数;默认是5条',
  `create_by` varchar(64) NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信账号';

