/*Table structure for table `wx_fans` */

DROP TABLE IF EXISTS `wx_fans`;

CREATE TABLE `wx_fans` (
  `id` varchar(64) NOT NULL,
  `open_id` varchar(100) DEFAULT NULL COMMENT 'openId',
  `subscribe_status` int(1) DEFAULT '1' COMMENT '订阅状态',
  `subscribe_time` varchar(50) DEFAULT NULL COMMENT '订阅时间',
  `nick_name` varbinary(50) DEFAULT NULL COMMENT '昵称',
  `sex` tinyint(4) DEFAULT NULL COMMENT '性别 0-女；1-男；2-未知',
  `language` varchar(50) DEFAULT NULL COMMENT '语言',
  `country` varchar(30) DEFAULT NULL COMMENT '国家',
  `province` varchar(30) DEFAULT NULL COMMENT '省',
  `city` varchar(30) DEFAULT NULL COMMENT '城市',
  `head_img_url` varchar(255) DEFAULT NULL COMMENT '头像',
  `status` tinyint(4) DEFAULT '1' COMMENT '用户状态 1-可用；0-不可用',
  `remark` varchar(50) DEFAULT NULL COMMENT '备注',
  `wx_id` varchar(50) DEFAULT NULL COMMENT '微信号',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `account` varchar(100) DEFAULT NULL COMMENT '微信账号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信粉丝';

/*Data for the table `wx_fans` */

/*Table structure for table `wx_img_resource` */

DROP TABLE IF EXISTS `wx_img_resource`;

CREATE TABLE `wx_img_resource` (
  `id` varchar(32) NOT NULL,
  `media_id` varchar(100) DEFAULT NULL COMMENT '微信返回的mediaId',
  `true_name` varchar(100) NOT NULL COMMENT '图片原名称',
  `type` varchar(10) NOT NULL COMMENT '图片尾缀名类型',
  `name` varchar(100) NOT NULL COMMENT ' 图片存储名称',
  `url` varchar(200) NOT NULL COMMENT '图片路径',
  `http_url` varchar(200) DEFAULT NULL COMMENT '图片http访问路径',
  `size` int(9) NOT NULL DEFAULT '1' COMMENT '图片大小byte',
  `flag` int(1) NOT NULL DEFAULT '0' COMMENT '图片状态字段：0.未引用 ，1.已被引用',
  `account` varchar(100) DEFAULT NULL COMMENT '微信账号',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信图片资源';

/*Data for the table `wx_img_resource` */

/*Table structure for table `wx_media_files` */

DROP TABLE IF EXISTS `wx_media_files`;

CREATE TABLE `wx_media_files` (
  `id` varchar(64) NOT NULL,
  `media_type` varchar(20) DEFAULT NULL COMMENT '媒体类型',
  `title` varchar(20) DEFAULT NULL COMMENT '标题',
  `introduction` varchar(500) DEFAULT NULL COMMENT '简介说明',
  `logic_class` varchar(50) DEFAULT NULL COMMENT '标签_逻辑分类',
  `media_id` varchar(100) DEFAULT NULL COMMENT '返回的media_id',
  `upload_url` varchar(200) DEFAULT NULL COMMENT '返回的wx服务器url',
  `remarks` varchar(500) DEFAULT NULL COMMENT '备注_预留',
  `account` varchar(100) DEFAULT NULL COMMENT '微信号',
  `base_id` varchar(64) DEFAULT NULL COMMENT '关联base表',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信素材信息';

