/*Table structure for table `wx_menu` */

DROP TABLE IF EXISTS `wx_menu`;

CREATE TABLE `wx_menu` (
  `id` varchar(64) NOT NULL,
  `mtype` varchar(50) DEFAULT NULL COMMENT '消息类型： click - 事件消息；view - 链接消息 ',
  `event_type` varchar(50) DEFAULT NULL,
  `title` varchar(100) DEFAULT NULL COMMENT '菜单名称',
  `input_code` varchar(255) DEFAULT NULL,
  `url` varchar(255) DEFAULT NULL COMMENT '页面地址',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `parent_id` int(11) DEFAULT NULL,
  `msg_type` varchar(64) DEFAULT NULL,
  `msg_id` varchar(100) DEFAULT NULL,
  `gid` int(11) DEFAULT NULL,
  `account` varchar(100) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL COMMENT 'create_date',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='菜单管理';

/*Data for the table `wx_menu` */

/*Table structure for table `wx_menu_group` */

DROP TABLE IF EXISTS `wx_menu_group`;

CREATE TABLE `wx_menu_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) DEFAULT NULL,
  `enable` int(11) DEFAULT NULL,
  `create_date` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `wx_menu_group` */

/*Table structure for table `wx_msg_base` */

DROP TABLE IF EXISTS `wx_msg_base`;

CREATE TABLE `wx_msg_base` (
  `id` varchar(64) NOT NULL,
  `msg_type` varchar(20) DEFAULT NULL COMMENT '消息类型',
  `input_code` varchar(20) DEFAULT NULL COMMENT '关注者发送的消息',
  `rule` varchar(20) DEFAULT NULL COMMENT '规则，目前是 “相等”',
  `enable` int(11) DEFAULT NULL COMMENT '是否可用',
  `read_count` int(11) DEFAULT '0' COMMENT '消息阅读数',
  `favour_count` int(11) unsigned zerofill DEFAULT '00000000000' COMMENT '消息点赞数',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信消息';

/*Data for the table `wx_msg_base` */

/*Table structure for table `wx_msg_news` */

DROP TABLE IF EXISTS `wx_msg_news`;

CREATE TABLE `wx_msg_news` (
  `id` varchar(64) NOT NULL,
  `mult_type` varchar(5) DEFAULT NULL COMMENT '单图文多图文类型',
  `title` varchar(30) DEFAULT NULL COMMENT '标题',
  `author` varchar(255) DEFAULT NULL COMMENT '作者',
  `brief` varchar(255) DEFAULT NULL COMMENT '简介',
  `content` longtext COMMENT '描述',
  `pic_path` varchar(255) DEFAULT NULL COMMENT '封面图片',
  `pic_dir` varchar(255) DEFAULT NULL COMMENT '封面图片绝对目录',
  `show_pic` int(11) DEFAULT '0' COMMENT '是否显示图片',
  `url` varchar(255) DEFAULT NULL COMMENT '图文消息原文链接',
  `from_url` varchar(255) DEFAULT NULL COMMENT '外部链接',
  `base_id` int(11) DEFAULT NULL COMMENT '消息主表id',
  `media_id` varchar(100) DEFAULT NULL COMMENT '上传后返回的媒体素材id',
  `thumb_media_id` varchar(150) DEFAULT NULL COMMENT '封面图片id',
  `news_index` int(11) DEFAULT NULL COMMENT '多图文中的第几条',
  `account` varchar(100) DEFAULT NULL,
  `create_date` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='图文管理';

